webpackJsonp([89967345138969],{6890:function(e,t){e.exports={data:{post:{html:'<p>16:38 "currently at uefa fanpark. 15000 visitors gathering slowly in front of the giant screen. beer prices very humane: 0.5 l carlsberg for 2.20. we\'re leaving now for the stadio"</p>\n<p>If you\'re watching TV this evening, my wife will be in a group of a dozen businesspeople in white replica 1954 World Cup German jerseys, in honor of the <a href="http://www.german-cinema.de/archive/film_view.php?film_id=832">Miracle of Bern</a> 50 years ago today. They should stand out in the sea of red and blue. </p>\n<p><strong>Update 19:00:</strong></p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/07/mms.jpg" alt="" /></p>',fields:{title:"SMS from Lisbon",date:"04 Jul 2004",url:"https://papascott.de/2004-07-04-sms-from-lisbon/"}}},pathContext:{slug:"/2004-07-04-sms-from-lisbon/",prev:{fields:{title:"Modern is who wins",date:"04 Jul 2004",slug:"/2004-07-04-modern-is-who-wins/"}},next:{fields:{title:"Converting Manila Not",date:"07 Jul 2004",slug:"/2004-07-07-converting-manila-not/"}}}}}});
